console.log("Hello");const likeButtons=document.querySelectorAll(".like-Post");for(let t of likeButtons)t.addEventListener("click",likeButtonListener);const toggler=function(t){"black"==t.style.color?t.style.color="red":t.style.color="black"};function likeButtonListener(t){t.currentTarget.id;toggler(t.currentTarget),console.log(t.currentTarget.id.split("-")[1]),$.ajax({type:"post",url:"/like/",data:{likable_id:t.currentTarget.id.split("-")[1],entity_type:t.currentTarget.className.split("-")[1]}})}